"      </td>",
"      <td>",
"       Usually normal",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle2_left\" colspan=\"2\">",
"       Advanced studies",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"indent1\">",
